          "nb" : "Konteksten for dette begrepet er grunnleggende personopplysninger i NAV. I [persondataløsningen |https://jira.adeo.no/browse/BEGREP-2189]brukes kilde om enten: * en norsk institusjon, eller * en utenlandsk institusjon, eller * brukeren selv eller en representant for denne.Folkeregisteret er i en del tilfeller bare registerfører for andre institusjoner. I slike tilfeller er det Folkeregisterets kilde som er interessant for NAV."
