          "nb" : "Vilkårene som må oppfylles for å få denne stønaden er som følger: Forelder og barnet må ha vært medlem av folketrygden de tre siste årene. Forelder og barnet må oppholde seg i Norge. Forelder må være ugift, skilt eller separert. Forelder må være alene om omsorgen for barnet. Forelder må ikke ha et forhold til den andre av barnets foreldre som kan bety at vedkommende ikke er enslig mor eller far. Forelder må ikke ha samboer. Forelder anses ikke som enslig mor eller far dersom vedkommende mottar eller tidligere har mottatt stønad til enslig mor eller far og får et nytt barn med samme partner. Stønad til barnetilsyn etter folketrygdloven § 15-10 er ikke det samme som stønad til pass av barn. Stønaden etter folketrygdloven § 15-10 er 64 prosent av dokumenterte utgifter til barnetilsyn opptil de beløp som Stortinget fastsetter. Det gis ikke stønad når den pensjonsgivende inntekten er større enn seks ganger grunnbeløpet."
        },
