      "definition" : {
        "text" : {
          "nb" : "bostedsland etter skatteavtale som følge av at skattepliktig har påberopt seg skattemessig bosted i Norge eller et annet land for å forhindre dobbeltbeskatning"
        },
        "remark" : {
          "nb" : "Om du både er skattemessig bosatt i Norge etter norsk intern rett, og skattemessig bosatt i oppholdslandet etter det landets interne rett, skal bostedsspørsmålet avgjøres etter bestemmelsene i skatteavtalen mellom Norge og det andre landet. Det samme gjelder om du blir skattemessig bosatt i Norge og fortsatt er skattemessig bosatt i det landet som du har flyttet fra.\nNår du er skattemessig bosatt i begge land, skal din bostedsmessige status avgjøres etter bestemmelsene i skatteavtalens artikkel om skattemessig bopel (vanligvis artikkel 4). Etter denne bestemmelsen skal du anses som bosatt i det land der du disponerer fast bolig. Har du fast bolig i begge land, er det avgjørende hvor du har de ”sterkeste personlige og økonomiske forbindelser (sentrum for livsinteressene)”. Om dette ikke gir noe klart svar, eller du ikke har fast bolig i noen av landene, skal du anses skatteavtalemessig bosatt i det landet der du har vanlig opphold. Har du vanlig opphold i begge land skal du anses bosatt i det landet der du er statsborger."
        },
        "sources" : [ ]
      },
      "subject" : {
