      },
      "example" : {
        "nb" : "Peter har oppholdt seg 190 dager i Spania, og 62 dager i Norge i et inntektsår. Peter ansees som skattemessig bosatt i Spania og Norge etter gjeldende lands skattelover. For å unngå dobbeltbeskatning hevder Peter å være bosatt i Spania etter skatteavtalens artikkel 4. Peter dokumenterer skattemessig bosted overfor norske ligningsmyndigheter ved å legge fram en bekreftelse fra spanske skattemyndigheter som fastslår at skattemyndighetene anser ham for å være skattemessig bosatt i Spania iht. skatteavtalen."
