          "nb" : "To personer som ikke er gift/registrerte partnere, er meldepliktige etter ftrl. § 25-4 første ledd første punktum, jf. § 1-5  når\n- minst en av dem har rett til pensjon eller overgangsstønad fra folketrygden, eller rett til avtalefestet pensjon som det godskrives pensjonspoeng for \n- de er samboere dvs. de bor i samme bygning, og\n- paret enten\n- har eller har hatt felles barn, og/eller\n- tidligere har vært gift med hverandre eller vært registrerte partnere\nMeldepliktig samboer i skattelovens forstand omfatter ikke de samboere som har meldeplikt etter ftrl § 25-4 første ledd annet og tredje punktum, dvs. de som:\n- har meldeplikt om samboerskap som har vart minst 12 av de siste 18 måneder (har ikke felles barn og er ikke tidligere gift  med hverandre)\n- mottar overgangsstønad for enslig mor eller far og som plikter å gi arbeids- og velferdsetaten melding når vedkommende ikke lenger kan regnes som enslig mor eller far etter § 15-4."
