      "definition" : {
        "text" : {
          "nb" : "fradrag i alminnelig inntekt til person som mottar utvidet barnetrygd for barn under 18 år som personen forsørger"
        },
        "remark" : {
          "nb" : "Vilkårene for å få utvidet barnetrygd fra NAV er at en er enslig forsørger og bor alene med omsorg for barn under 18 år. Den enslige forsørgeren må være ugift, skilt, separert, enke/enkemann eller ikke leve med samboer på varig basis. \n\nFor hver måned den skattepliktige mottar utvidet barnetrygd etter barnetrygdloven § 9, har man rett til særfradrag i alminnelig inntekt etter standardsats i Stortingets skattevedtak. Mottar skattepliktig halv utvidet barnetrygd, gis det et halvt særfradrag."
        },
        "source" : {
          "prefLabel" : {
