      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "den samlede mindreskatten som skatteyter ville ha fått om etterbetalt pensjon og trygdeytelser i inntektsåret var blitt skattlagt i opptjeningsårene,"
        },
        "remark" : {
          "nb" : "Skattyteren har krav på å bli skattlagt etter det alternativet som gir lavest skatt alle årene sett under ett. Eventuell rentegodtgjørelse skal holdes utenfor ved sammenligningen. Hjemmelen er FSFIN § 14-3-1 som sier: \"Skatt og trygdeavgift på etterbetalte offentlige eller private pensjoner samt trygdeytelser som utbetales gjennom trygdemyndighetene i henhold til lov, skal ved skattefastsettingen for utbetalingsåret beregnes til det beløpet som skatten og trygdeavgiften ville ha utgjort om pensjons- eller trygdebeløpene var blitt skattlagt i de år utbetalingene refererer seg til. Dette gjelder likevel bare når skattyteren har skattemessig fordel av det.\" Skatte-ABCen skriver i emnet Etterbetaling av pensjon, trygdeytelser eller lønn under trygdeytelse og pensjon i pkt. 2.5.6  Skatteoppgjøret: \"Skatteoppgjørsblanketten vil vise den inntekt som er utbetalt i inntektsåret, og skatten på denne inntekten. Den samlede mindreskatten blir trukket fra i summen av de ordinære skatter på formue og inntekt, samt trygdeavgift, med tekst «Korrigering pga. etterbetalt pensjon/trygdeytelser for tidligere år». Unntaksvis kan mindreskatten overstige sum av skattene for siste inntektsår. Eventuelt overskytende beløp skal utbetales skattyteren.\""
        },
        "source" : {
          "prefLabel" : {
            "nb" : "FSFIN § 14-3-1"
