      "definition" : {
        "text" : {
          "nb" : "For at behandlingen av en personopplysning skal være lovlig må det finnes et behandlingsgrunnlag. Det må identifiseres et behandlingsgrunnlag for behandlingen av hver enkelt personopplysning og hvert enkelt formål.Etter personopplysningslovens artikkel 6 første ledd punkt 1 vil en behandling av personopplysninger kun være lovlig dersom og i den grad minst ett av følgende vilkår er oppfylt:a) den registrerte har samtykket til behandling av sine personopplysninger for ett eller flere spesifikke formålb) behandlingen er nødvendig for å oppfylle en avtale som den registrerte er part i, eller for å gjennomføre tiltak på den registrertes anmodning før en avtaleinngåelsec) behandlingen er nødvendig for å oppfylle en rettslig forpliktelse som påhviler den behandlingsansvarliged) behandlingen er nødvendig for å verne den registrertes eller en annen fysisk persons vitale interessere) behandlingen er nødvendig for å utføre en oppgave i allmennhetens interesse eller utøve offentlig myndighet som den behandlingsansvarlige er pålagtf) behandlingen er nødvendig for formål knyttet til de berettigede interessene som forfølges av den behandlingsansvarlige eller en tredjepart, med mindre den registrertes interesser eller grunnleggende rettigheter og friheter går foran og krever vern av personopplysninger, særlig dersom den registrerte er et barn"
        },
