          "nb" : "en kategori som beskriver behovet til brukere som vil komme i arbeid hovedsakelig gjennom egenaktiviteter og i løpet av relativt kort tid. \n\n\n"
        },
        "remark" : {
          "nb" : "Innsatsgruppen inngår i oppfølgingsvedtak som beskriver brukers behov for bistand for å komme ut i arbeid. \"Standardinnsats tilbys brukere som forventes å kunne nå sitt mål om arbeid hovedsakelig gjennom egenaktiviteter og i løpet av relativt kort tid ...]\". \n\n\"Dette utfallet innebærer en innsats fra NAV som i hovedsak kun omfatter de generelle tjenestene som er tilgjengelig for alle brukere. Individuelt tilpassede tjenester kan tilbys i form av formidlingsbistand, veiledning i yrkesvalg, jobbsøking og lignende. Brukeren har ikke rett til en aktivitetsplan, men bør kunne tilbys dette dersom det er hensiktsmessig eller dersom brukeren selv ønsker det.\""
        },
        "source" : {
          "prefLabel" : {
            "nb" : "LOV-2006-06-16-20 Lov om arbeids- og velferdsforvaltningen (arbeids- og velferdsforvaltningsloven) NAV-loven] § 14a; \n\"Standardinnsats\". I: Retningslinjer for oppfølgingsvedtak i NAV s. 5. Hentet 15. april 2016 fra https://navet.adeo.no/ansatt/Fag/Arbeid+og+aktivitet/Relatert+innhold/retningslinjer-14a"
          }
        },
        "sources" : [ {
